import React, { Component } from 'react'
import './style.css'

class toDoItem extends Component {
    constructor(props){
        super(props)
    }

    render() {
        return (
            <div>
                <li><p>{this.props.task.name}</p><p className="edit">Edit</p><h5 className='remove' onClick={()=>this.props.handleDelete(8)}>X</h5></li>
            </div>
        )
    }
}
export default toDoItem;
